import styled from "styled-components/macro";

export const StyledHomePageDiv = styled.div`
  width: 900px;
  margin: 20px auto;
`;

export const StyledHMessageDiv = styled.div`
  display: flex;
  margin-bottom: 10px;
  h6 {
    font-size: 16px;
    margin-right: 20px;
    font-weight: "bold";
    margin-bottom: 0px;
  }
  p {
    margin-right: 20px;
    margin-bottom: 0px;
  }
  span {
    margin-top: 5px;
  }
`;
